          disabled: !this.blockId,
          href: '/curriculum/courses/' + this.courseId + '/unit/' + this.unitId
        },
        {
          text: 'Lessons',
          disabled: !this.lessonId,
          href: '/curriculum/courses/' + this.courseId + '/unit/' + this.unitId + '/block/' + this.blockId
        }
      ]
